import React from 'react';

interface BeverageModulProps {
  rowsCount: number;
  columnsCount: number;
  bottlesArray: {
    name: string;
    price: number;
  }[];
}

export default function BeverageModul(props: BeverageModulProps) {
  const { bottlesArray } = props;

  return (
    <div>
      {bottlesArray.map((bottle, index) => {
        return (
          <div key={index}>
            <p>{bottle.name}</p>
            <p>{bottle.price}</p>
          </div>
        );
      })}
    </div>
  );
}
